import { Component, OnInit } from '@angular/core';
import { NgForm } from '@angular/forms';
import { Router } from '@angular/router';
import { Pass } from '../shared/user.model';
import { UserService } from '../shared/user.service';

@Component({
  selector: 'app-resetpassword',
  templateUrl: './resetpassword.component.html',
  styleUrls: ['./resetpassword.component.css']
})
export class ResetpasswordComponent implements OnInit {

  public pass: Pass;

  constructor(private userService : UserService,
    public readonly router: Router) { }

  ngOnInit(): void {
    this.resetForm();
  }

  public resetForm(form?: NgForm) {
    if (form != null)
      form.reset();
    this.pass = {
     Password:'',
     MobileNumber:'',
    }
  }

  public async OnSubmit(form: NgForm): Promise<void> {
    this.userService.resetPassword(form.value)
    .subscribe(()=>{
      // sessionStorage.setItem('loggedUser', this.login.Email);
      //this.userService.loginUser(this.loginUser.Email);
     this.router.navigateByUrl('login');
    this.resetForm(form);
    });
  }

}
<body>
    <img src="../pickawood-gf8e6XvG_3E-unsplash.jpg" class="img">
        <div class="center">
        <h1>Reset Password</h1>
        <form method="post" class="col s12 white" #reset="ngForm" (ngSubmit)="OnSubmit(reset)">
            <div class="txt_field">
                <input  class="validate" type="text" name="MobileNumber" #MobileNumber="ngModel" [(ngModel)]="pass.MobileNumber" required  minlength="3">
                <span></span>
                <label>Enter MobileNumber</label>
              </div>
            <div class="txt_field">
                <input  class="validate" type="text" name="password1"  required  minlength="3">
                <span></span>
                <label>New Password</label>
              </div>
              <div class="txt_field">
                <input  class="validate" type="text" name="password2" #Password="ngModel" [(ngModel)]="pass.Password" required  minlength="3">
                <span></span>
                <label>Confirm Password</label>
              </div>
              <input type="submit" value="Reset">
               <div class="signup_link">
             </div>
        </form>
      </div>

    </body>
    <script>

        // Function to check Whether both passwords
        // is same or not.
        function checkPassword(form) {
            password1 = form.password1.value;
            password2 = form.password2.value;

            // If password not entered
            if (password1 == '')
                alert ("Please enter Password");

            // If confirm password not entered
            else if (password2 == '')
                alert ("Please enter confirm password");

            // If Not same return False.    
            else if (password1 != password2) {
                alert ("\nPassword did not match: Please try again...")
                return false;
            }

            // If same return True.
            else{
                alert("Password Match: Welcome to GeeksforGeeks!")
                return true;
            }
        }
    </script>
